/**
 * Vue Method: _content_width
 * Calculates maximum content width for each breakpoint
 */

function _content_width() {
  var obj = {};
  var app = this;

  for (var i = 0; i < app.breakpoints.length; i++) {
    if ((i + 1 < app.breakpoints.length)) {
      var w = Math.min(parseInt(app.breakpoints[i + 1].value) - 1, parseInt(app.wrapper.maxwidth));
      obj[i] = w - app.breakpoints[i].wrapperGutter * 2;
    }
    else {
      obj[i] = (app.wrapper.maxwidth) - app.breakpoints[i].wrapperGutter * 2;
    }
  }

  return obj;
}

/**
 * Vue Method: _import_googlefonts_string
 * Constructs the CSS string to import Google Fonts
 * 
 * E.G.
 * https://fonts.googleapis.com/css2?family=Roboto:ital,wght@0,100;0,300;0,400;0,500;0,700;0,900;1,100;1,300;1,400;1,500;1,700;1,900&display=swap
 */

function _import_googlefonts_string() {
  var selectedFonts = this.fonts;
  var str = 'https://fonts.googleapis.com/css2?';

  for (var font in selectedFonts) {
    str += 'family=' + selectedFonts[font].family.replace(/ /g, '+') + ':ital,wght@';
    var tuples = [];
 
    for (var variant in selectedFonts[font].selectedVariants) {
      var thisVariant = selectedFonts[font].selectedVariants[variant];

      if (thisVariant == 'regular') thisVariant = '0,400';
      else if (thisVariant == 'italic') thisVariant = '1,400';
      else if (thisVariant.split('italic').length > 1) {
        thisVariant = '1,' + thisVariant.split('italic')[0];
      }
      else thisVariant = '0,' + thisVariant;

      tuples.push(thisVariant)
    }

    str += tuples.sort().join(';') + '&';
  }

  str += 'display=swap';

  return str;
}

/**
 * Vue Method: _download_app_data
 * Downloads app data as JSON
 */

function _download_app_data() {
  var userdata = {
    colors: app.colors,
    breakpoints: app.breakpoints,
    wrapper: app.wrapper,
    fonts : app.fonts,
    specimen: app.specimen
  }

  app._download_file(
    JSON.stringify(userdata), 
    'application/json', 
    'Project_Data'
  );
}

/**
 * Vue Method: _download_colors
 * Downloads color data as SCSS
 */

function _download_colors() {
  var data = '/**\n * Colors\n */\n\n';

  for (var color in app.colors) {
    var color = app.colors[color];
    var title = color.title.toLowerCase().trim().replace(/[^A-Za-z0-9]/g, '-').replace(/-{2,}/g, '-');
    var code = color.code.toLowerCase().trim();

    if (title.length && code.length) {
      data += '$' + title + ': ' + code + ";\n";
    }
  }

  app._download_file(
    data, 
    'text/css', 
    '_colors.scss'
  );
}

/**
 * Vue Method: _download_file
 * Downloads a file
 * 
 * Callers: 
 * createdata/_download_app_data
 * createdata/_download_colors
 * createdata/_download_layout
 * _download_file_all
 *
 * @param {data} file data to be written to the document
 * @param {mime} file mimetype. e.g. application/json
 * @param {filename} can be with or without an extension
 */

function _download_file(data, mime, filename) {
  var link = document.createElement('a');

  link.download = filename;
  link.href = 'data:'+ mime +',' + encodeURIComponent(data);
  link.click();
}

/**
 * Vue Method: _download_file_all
 * Downloads all files
 */

function _download_file_all() {
  app._download_app_data();
  app._download_colors();
  app._download_layout();
  app._download_fonts();
  app._download_typography();
}

/**
 * Vue Method: _download_fonts
 * Downloads fonts data as SCSS
 */

function _download_fonts() {
  var data = '/**\n * Fonts\n';
  data += ' *\n';
  data += ' * Should always default to a system font stack\n';
  data += ' * https://css-tricks.com/snippets/css/system-font-stack/\n';
  data += ' */\n\n';

  data += '@import url("'+ app._import_googlefonts_string +'");\n\n';

  data += '.sans {\n'+
    '  font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif;\n'+
  '}\n';

  app._download_file(
    data, 
    'text/css', 
    '_fonts.scss'
  );
}

/**
 * Vue Method: _download_layout
 * Downloads layout data as SCSS
 */

function _download_layout() {
  function data_loop(value) {
    var data = '';

    for (var i in app.breakpoints) {
      var bp = app.breakpoints[i];

      if (bp.title && bp.value && bp[value]) {
        data += '  ' + bp.title.toLowerCase() + ': ' + bp[value] + 'px,\n';
      }
    }

    return data;
  }

  var data = '/**\n * Layout\n */\n\n';

  /**
   * Breakpoints
   */

  data += '// Breakpoints\n';
  data += '$site-breakpoints: (\n';
  data += data_loop('value');
  data += ');\n\n'

  /**
   * Rows & Columns
   */

  data += '// Columns and Rows\n' +
    '$row-class: ".row";\n' +
    '$column-class: ".col";\n' +
    '$column-count: 12;\n\n';

  /**
   * Column Gutters
   */

  data += '$column-gutter: (\n';
  data += data_loop('columnGutter');
  data += ');\n\n'

  /**
   * Wrapper Settings
   */
  data += '$wrapper-max-width: ' + app.wrapper.maxwidth + 'px;\n\n';

  data += '$wrapper-gutter: (\n';
  data += data_loop('wrapperGutter');
  data += ');\n\n'

  app._download_file(
    data,
    'text/css',
    '_layout.scss'
  );
}

/**
 * Vue Method: _download_typography
 * Downloads typography data as SCSS
 */

/**
 * Verifies that the selector has properties
 * and at least one of those has a value
 */
function validateSelector (sel) {
  if ( Object.keys(sel).length ) {

    for (var prop in sel) {
      if(sel[prop].trim().length) {
        return true;
        break;
      }
    }

  }

  return false;
}

function _download_typography() {
  var data = '/**\n * Typography\n */\n\n';

  data += '.type- {';

  // loop breakpoints
  for (var i in app.breakpoints) {
    var styles = app.breakpoints[i].styles;
    var indent = '  ';

    // ignore sm breakpoint
    if (app.breakpoints[i].title != 'sm') {
      data += '\n  @include mq(' + app.breakpoints[i].title + ') {';
      indent = '    ';
    }

    // loop breakpoint styles
    for (var selector in styles) {
      if( validateSelector(styles[selector]) ) {

        // begin selector
        data += '\n'+ indent +'&' + selector.toLowerCase() + ' {\n';

        // loop selector properties
        for (var prop in styles[selector]) {
          var val = styles[selector][prop].trim();

          // ignore empty value properties
          if(val.length) {

            // wrap font family value with double quotes (for multiple word fontfaces)
            if (prop == "font-family") {
              val = '"' + val + '"';
            }

            data += '  ' + indent + prop + ': ' + val + ';\n';
          }
        }

        // end selector
        data += indent + '}\n';
      }
    }

    // ignore sm breakpoint
    if (app.breakpoints[i].title != 'sm') {
      data += '  }\n';
    }
  }

  data += '}\n';

  app._download_file(data, 'text/css', '_typography.scss');
}

/**
 * Vue Method: _font_add
 * Adds a font to the list of used fonts
 */

function _font_add() {
  var fontName = googlefontpicker.value;
  var googlefonts = app.googlefonts.items;

  for(var id in googlefonts) {
    var font = googlefonts[id];

    if(font.family == fontName) {
      var defaultVariant = font.variants.includes('regular') ? ['regular'] : [font.variants[0]];

      app.fonts.push({
        family: fontName,
        selectedVariants: defaultVariant
      });

      googlefontpicker.value = '';

      break;
    }
  }
}

/**
 * Vue Method: _font_family_change
 * Handles default font weight selection based on selected font family
 */

function _font_family_change(e) {
  delete app.bindstyles['font-weight'];
  delete app.bindstyles['font-style'];
}

/**
 * Vue Method: _font_remove
 * Removes a font from the list of used fonts
 */

function _font_remove(index) {
  /**
   * When removing a font family, 
   * make sure we remove all style references
   * to that family, including font-weight and italics.
   */

  for (bp in app.breakpoints) {
    var thisStyles = app.breakpoints[bp].styles;

    for (selector in thisStyles) {
      var thisSelector = thisStyles[selector];

      if(thisSelector['font-family'] == app.fonts[index].family) {
        delete thisSelector['font-family'];
        delete thisSelector['font-weight'];
        delete thisSelector['font-style'];
      }
    }
  }

  app.fonts.splice(index, 1);
}

/**
 * Vue Method: _load_file
 * Reads an imported json file
 */


function _load_file(event) {
  const input = event.target;

  if ('files' in input && input.files.length > 0) {
    var reader = new FileReader();
    var file = input.files[0];

    return new Promise(function (resolve, reject) {
      reader.onload = function (event) {
        resolve(event.target.result)
      }

      reader.onerror = function (error) { 
        reject(error) 
      }

      reader.readAsText(file);
    })
      .then(function (data) {
        _load_save(app, data);
      })
      .catch(function (error) {
        console.log(error)
      });
  }
}


/**
 * Vue Method: _load_save
 * Loads data into the project
 */

function _load_save(app, data) {
  if(!data) return false;

  Object.assign(app._data, JSON.parse(data));
  app.$forceUpdate();
}


